    false,nt"url": null,nt"notes": "The USGS Ferromanganese Crust data set
    was compiled by F.T. Manheimn     and C.M. Lane-Bostwick of the U.S. Geological
    Survey, Woods Hole, MA. The data setn     consists of tables corresponding the USGS
    Open-File Report 89-020 "Chemicaln     Composition of Ferromanganese Crusts in
    the World Oceans: A Review and Comprehensiven     Database." Data include excerpts
    from the SIO nodule file, the NOAA and MMS marine mineralsn     data base, Japanese
    sources, a Ph.D. thesis, analyses performed at the Bureau ofn     Mines, and analyses
    performed at other laboratories under the direction of the USGS.n     These data
    are also included on the NOAA and MMS Marine Minerals CD-ROM data setn     released
    by the former National Geophysical Data Center (now NOAA's National Centers for
    Environmental Information)n     in October of 1992. The USGS crust are also available
    for download from NCEI's Web site.",nt"license_title": null,nt"extras":
